import Expenses from './components/Expense/Expenses';

function App() {


  const arr=[
    {
     desc:"car insurance",
     price:23.4,
     date:new Date(2020,12,28),
    },
    {
      desc:"rent",
     price:21.5,
     date:new Date(2021,2,20),
    },
    {
      desc:"laundary",
     price:10.2,
     date:new Date(2021,3,10),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>React is so much fun to learn</p>
      <Expenses  items={arr}></Expenses>
     </div>
  );
}

export default App;
